function [data,year,T,central] = makear4fig610c(smoothing,colorscheme)
	
%  MAKEAR5FIG610C  Self contained function to duplicate IPCC AR4 Figure 6.10C
%          
%      [data,year,T,central] = makear4fig610c(smoothing,colorscheme)
%
% Can be optionally called with outputs for more plotting control.  Input 'smoothing' is an
% integer for the period of the low pass filtering of the central tendency of the probability
% plot.  If 'smoothing' is set to 0, no central tendency is plotted.  Default 'smoothing' is 30 years.
%
%   http://www.ncdc.noaa.gov/paleo/pubs/ipcc2007/fig610.html
%

if nargin == 0
 smoothing = 30; colorscheme = 'jet'; % 30 default to match caption from Figure 6.10c
end

if nargin == 1
 colorscheme = 'jet'; % set to 'jet' colormap as default
end

% get the data
[T,data] = getdata; % call to getdata subfunction
year = data(:,1);
data = data(:,2:end);

% data read error check
% data(data<=0) = NaN;

% get a maximum central tendency
if smoothing ~= 0
[val,indx] = max(data,[],2)
central = lowpass(T(indx)',1/smoothing,1,1)
end

% plotting options
set(0, 'DefaultAxesFontName', 'Helvetica','DefaultAxesFontWeight','bold')
set(0, 'DefaultTextFontName', 'Helvetica','DefaultTextFontWeight','bold')  
set(0,'defaultaxesfontsize',12); set(0,'defaulttextfontsize',11); 

% plot
[fx] = figure; clf; hold on;
[hfx,cfx] = contourf(year,T,data',[0:5:100]); set(cfx,'linestyle','none')
set(gca,'xgrid','on')
set(gca,'layer','top')
set(gca,'box','on')
set(gca,'layer','top')

if ~strcmp(colorscheme,'hot')
 mycolormap = colormap; mycolormap(1:9,:) = 1; colormap(mycolormap);
else
 colormap(flipud(hot))
end

shading flat
caxis([0 100])

if smoothing ~= 0
 plot(year,central,'k','linewidth',2)
end

xlabel('YEAR')
ylabel('T ANOMALY (^{\circ}C)')
ylim([-1.3 .3])
xlim([700 2000])

hc = colorbar('horiz','location','south');
set(hc,'position',[0.17 0.215 0.35 0.03]);
hd = discretecolorbar(hc,[0 100],[0:10:100],'horiz');
set(hd,'xtick',[0:20:100]);
xlabel('% AGREEMENT ')


